import './App.css'

// Navigation Bar Button
function NavButton ({ button_title }) {
  return (
    <>
      <button type='button' className='roboto-condensed-buttons'> { button_title } </button>
    </>
  );
}

// Navigation Bar
function Navbar () {
  return (
    <>
      <div className='navbar'>
          <NavButton button_title={'Profile'} />
          <NavButton button_title={'Option'} />
          <NavButton button_title={'Option'} />
          <NavButton button_title={'MY PROJECT'} />
          <NavButton button_title={'Log Out'} />
          <NavButton button_title={'About Us'} />
      </div>
    </>
  );
}

// Opening Page
export default function Page () {
  return (
    <>
      <div>
        <Navbar />
      </div>
    </>
  );
}
